import React, { Component } from 'react';

export default class Todo extends Component {
    constructor(props) {
        super(props);
        this.state = {
            list: ['todo 1', 'todo 2', 'todo 3'],
        };
    }
    render() {
        return (
            <div>
                <section></section>
            </div>
        );
    }
}
